const Resume = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-12 col-sm-6 text-primary text-center my-5">
                    <h1>Personal Detail</h1>

                </div>
            </div>
        </div>
    )
}

export default Resume
